using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Identity;
using MongoDB.Bson.Serialization.Attributes;
using System.ComponentModel.DataAnnotations;
using System.Runtime.Serialization;

namespace BlogSimple.Model.Models;


public class User : ApplicationUser
{
    [BsonElement]
    [PersonalData]
    [Display(Name = "First Name")]
    [Required(ErrorMessage = "First Name is required")]
    public string FirstName { get; set; }

    [BsonElement]
    [PersonalData]
    [Display(Name = "Last Name")]
    [Required(ErrorMessage = "Last Name is required")]
    public string LastName { get; set; }

    [BsonElement]
    [DataMember]
    [PersonalData]
    [Required(ErrorMessage = "Username is required")]
    public string Username { get; set; }

    [BsonElement]
    [Required(ErrorMessage = "Password is required")]
    [StringLength(30, ErrorMessage = "Must be between 8 and 30 characters", MinimumLength = 8)]
    [DataType(DataType.Password)]
    public string Password { get; set; }

    [BsonElement]
    [DataType(DataType.Password)]
    [Display(Name = "Confirm Password")]
    [Required(ErrorMessage = "Confirm Password is required")]
    [StringLength(30, ErrorMessage = "Must be between 8 and 30 characters", MinimumLength = 8)]
    [Compare("Password")]
    public string ConfirmPassword { get; set; }

    [BsonElement]
    [Display(Name = "Header")]
    [StringLength(50, ErrorMessage = "Can only have a maximum of 50 characters", MinimumLength = 1)]
    public string Heading { get; set; }

    [BsonElement]
    public string Bio { get; set; }

    [BsonElement]
    [Display(Name = "Portfolio Website")]
    public string PortfolioLink { get; set; }

    [BsonElement]
    [Display(Name = "Twitter Link")]
    public string TwitterLink { get; set; }

    [BsonElement]
    [Display(Name = "GitHub Link")]
    public string GitHubLink { get; set; }

    [BsonElement]
    [Display(Name = "LinkedIn Link")]
    public string LinkedInLink { get; set; }

    [BsonElement]
    [Display(Name = "Profile Picture")]
    public IFormFile ProfilePictureInput { get; set; }

    [BsonElement]
    public byte[] ProfilePicture { get; set; } = Convert.FromBase64String(DefaultProfilePictureImageBase64String);

    [BsonElement]
    [Display(Name = "Cover Image")]
    public IFormFile HeaderImageInput { get; set; }

    [BsonElement]
    public byte[] HeaderImage { get; set; } = Convert.FromBase64String(DefaultHeaderImageBase64String);

    [BsonElement]
    public List<Post> FavoritedPosts { get; set; } = new List<Post>();

    private static string DefaultProfilePictureImageBase64String = "";
    private static string DefaultHeaderImageBase64String = "";
}
